import ajax from '../ajax'
const BASE = '/user'

// 获取所有站点列表
export const userLogin = (phone, password) => ajax(BASE + '/login', { phone, password }, 'POST')
// 获取乘客列表
export const getPassengerList = (id) => ajax(BASE + '/getPassengerList', { id })
